@LouisBoyard @Cyrilhanouna Pour le coup, je soutiens pas du tout les Nupes.. mais là, soutien total ! 

Marre de cet @Cyrilhanouna qui se croit au dessus de tout. 

Après on parle du manque de respect des jeunes envers la politique et lui, il insulte de « merde » un député ?! Où est l’exemple ?!
